  function unique(arr, key) {
    return Object.keys(
      data.map(o => o[key]).reduce((acc, v) => ({
        ...acc,
        [v]: true,
      }), {})
    );
  }

  function getQueryVariable(variable) {
    const query = window.location.search.substring(1);
    const vars = query.split("&");
    for (let i=0; i<vars.length; i++) {
      const pair = vars[i].split("=");
      if (pair[0] == variable) { return pair[1]; }
    }
  }
  const baseUrl = window.location.href.includes('?')
    ? window.location.href.split('?')[0]
    : window.location.href;

  const precincts = unique(data, 'precinct').sort();
  const zips = unique(data, 'zip').sort();

  for (const p of precincts) {
    const el = document.createElement('div');
    const a = document.createElement('a');
    a.innerHTML = p;
    a.href = `${baseUrl}?precinct=${p}`
    el.appendChild(a);
    document.getElementById('precincts').appendChild(el);
  }

  for (const z of zips) {
    const el = document.createElement('div');
    const a = document.createElement('a');
    a.innerHTML = z;
    a.href = `${baseUrl}?zip=${z}`
    el.appendChild(a);
    document.getElementById('zips').appendChild(el);
  }

  const qPrecinct = getQueryVariable('precinct');
  const qZip = getQueryVariable('zip');
  if (qPrecinct || qZip) {
    const results = qPrecinct
      ? data.filter(x => x.precinct == qPrecinct)
      : data.filter(x => x.zip == qZip);

    const resultsByVoterId = results.reduce((acc, p) => ({
      ...acc,
      [p.voterId]: ({
        ...p,
        reasons: [
          ...((acc[p.voterId] || {}).reasons || []),
          p.reason,
        ],
      }),
    }), {});

    console.log(results)
    console.log(resultsByVoterId)

    for (const id of Object.keys(resultsByVoterId)) {
      const p = resultsByVoterId[id];
      const tr = document.createElement('tr');
      tr.innerHTML = `<td>${p.voterId}</td> <td>${p.name}</td> <td>${p.birthYear}</td> <td>${p.reasons.join(', ')}</td>`;
      document.getElementById('results').appendChild(tr);
    }
  }
